HealBot_ExtraSkinDesc[1]=[[Group Skin

Aux Aggro is a 5 man skin using horizontal bars with threat above and
power below the health bar and aggro on the left and right of the health bar.
The skin is placed on the right of the screen.]]
HealBot_ExtraSkinDesc[2]=[[Small Raid Skin

Raid10 is a raid skin using horizontal bars with buffs left of the
health bar, debuffs right of the health bar, power below the health bar,
threat above the health bar and aggro below and above threat and power.
The skin is placed on the right of the screen.]]
HealBot_ExtraSkinDesc[3]=[[Large Raid Skin

Verena is a raid skin using horizontal bars
with power and aggro below the health bar.
The skin is placed on the bottom of the screen.]]
HealBot_ExtraSkinDesc[4]=[[Group Skin

Aux Group is a 5 man skin using horizontal bars with threat
and aggro left of the health bar, incoming heals and overheals
right of the health bar and power below the health bar.
The skin is placed on the right of the screen.]]
HealBot_ExtraSkinDesc[5]=[[Group Skin

Addydari is a 5 man skin using horizontal bars
with aggro above and below the health bar.
The skin is placed on the left of the screen.]]
HealBot_ExtraSkinDesc[6]=[[Large Raid Skin

Gridlike 40 is a raid 40 grid like skin
with power below the health bar.
